window.bookSummaryJSON = "<p>Three royal lovers, one goal: to make an alliance with their neighboring kingdom before war takes away their chance for peace.</p> <p>Now that Symon is happily married to his husband Petur and in love with Petur’s longtime lover Deyvid, things should be easier…right? Not with the Harrier clans of the north stirring up trouble. Tasked with escorting Petur’s nephew Arven to his wedding in neighboring Mersaighe, Symon hopes that things will go smoothly. He ought to know better. Not only are they heading into a nation where shifters like Petur are distrusted, Petur and his nephew fight constantly, an assassin is still trying to kill Deyvid, and Symon is hiding a secret of his own…one that could mean his days of happiness are numbered before a family curse drives him insane. </p> <p>With enemies to lovers, graphic violence, snarky humor, and explicit sexual content, Endurance is a polyamorous M/M/M fantasy that will keep you on the edge of your seat!</p>"; 
